// Grid.js
import React from 'react';
import Cell from './Cell';

const Grid = ({ grid, setGrid }) => {
  return (
    <div className="grid">
      {grid.map((row, i) =>
        row.map((cell, j) => (
          <Cell
            key={`${i}-${j}`}
            alive={cell}
            onClick={() => {
              const newGrid = [...grid];
              newGrid[i][j] = newGrid[i][j] ? 0 : 1;
              setGrid(newGrid);
            }}
          />
        ))
      )}
    </div>
  );
};

export default Grid;
